import { useEffect, useState } from "react";
import UseEmployerContext from "../../hooks/UseEmployerContext";
import "./EmployerProfile.css";
import Navbar from "../../components/Navbar";

const EmployerProfile = () => {
  const { employers, dispatch } = UseEmployerContext();
  const { popup, setPopup } = useState(false);
  const idEmployer = "66cb27361832cdc4bc0cef66";

  useEffect(() => {
    const fetchEmployer = async () => {
      const response = await fetch(
        `/API/Employer/single-employer/${idEmployer}`
      );
      const data = await response.json();
      console.log("data", data);

      if (response.ok) {
        dispatch({ type: "SET_EMPLOYER", payload: data });
      }
    };
    fetchEmployer();
  }, [dispatch]);

  const handleEdit = async() => {
    
      const response = await fetch(
        `/API/Employer/update-employer/${idEmployer}`,
        {
          method: "PATCH",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            data
          }),
        }
      );
      const data = await response.json();
      if (response.ok) {
        dispatch = { type: "UPDATE_EMPLOYER", Payload: data };
      }
    
  };

  return (
    <div className="employer-profile">
      {/* Profile Header */}
      <Navbar />

      <div className="profile-header">
        <img
          src={"https://randomuser.me/api/portraits/men/52.jpg"}
          alt="Profile"
          className="profile-logo"
        />
        <div className="profile-info">
          <h1 className="employer-name">{employers?.name}</h1>
          <p className="employer-company">{employers?.companyName}</p>
        </div>
        <button onClick={handleEdit}>Edit</button>
      </div>
      {/* About Me Section */}
      <div className="profile-about">
        <h2>About Me</h2>
        <p>
          Hi, I'm the founder of {employers?.companyName}, with a passion for
          innovation and excellence in the industry. With extensive experience
          and a strong vision, I have led the company to new heights.
        </p>
      </div>

      {/* Company Overview */}
      <div className="profile-company-overview">
        <h2>Company Overview</h2>
        <p>
          {employers?.companyName} is a leading firm specializing in [Industry],
          dedicated to delivering top-notch solutions and services to clients
          worldwide. Our mission is to innovate and provide the highest quality
          products that meet the evolving needs of our customers.
        </p>
      </div>

      {/* Competences Section */}
      <div className="profile-competences">
        <h2>Competences</h2>
        <ul>
          <li>Strategic Leadership</li>
          <li>Innovative Problem Solving</li>
          <li>Project Management</li>
          <li>Industry Expertise</li>
          {/* Add more competences as needed */}
        </ul>
      </div>

      {/* Experience Section */}
      <div className="profile-experience">
        <h2>Experience</h2>
        <div className="experience-item">
          <h3>Software Engineer at Tech Solutions Inc.</h3>
          <p>
            Developed and maintained web applications using React.js and
            Node.js. Led a team of 5 developers to successfully launch a
            customer management system, improving client satisfaction by 20%.
          </p>
        </div>

        <div className="experience-item">
          <h3>Junior Developer at Web Innovators LLC</h3>
          <p>
            Assisted in the development of e-commerce platforms. Worked on the
            frontend using HTML, CSS, and JavaScript, and integrated payment
            gateways, resulting in a 15% increase in conversion rates.
          </p>
        </div>

        <div className="experience-item">
          <h3>Intern at Startup XYZ</h3>
          <p>
            Collaborated with the engineering team to optimize database queries
            and improve website performance. Gained hands-on experience in
            full-stack development, contributing to a 30% reduction in page load
            times.
          </p>
        </div>

        {/* Add more experience items as needed */}
      </div>

      {/* Contact Information */}
      <div className="profile-contact-info">
        <h2>Contact Information</h2>
        <p>Email: {employers?.email}</p>
        {/* Add other contact details if needed */}
      </div>
    </div>
  );
};

export default EmployerProfile;
